            <div className="">
                <p>Lorem ipsum dolor sit amet consectetur, adipisicing elit. Maxime nemo delectus quidem libero commodi iste architecto debitis fuga sapiente dolorem! Repudiandae error a ipsum, voluptate minus architecto. Dolores, quod voluptatibus.
                Eum ad iste mollitia odio, excepturi dolores. Porro quam corporis consectetur dolor itaque reiciendis saepe laborum architecto ducimus doloribus consequuntur voluptatibus magnam asperiores, assumenda provident temporibus atque alias ut iusto.
                Autem, ab dolorum? Magni ratione nostrum tempore accusamus consequatur. Similique accusantium quis iusto quasi sequi consequatur minima laudantium corrupti voluptatibus sed quisquam illo consectetur excepturi et, repudiandae atque nesciunt consequuntur.</p>
            </div>
            <button className="kembali" onClick={()=> navigate('/')}>Cover</button>
        </div>
    )
};

export default Contentt;
